    return 0.5 * (Math.pow(value - 2, 3) + 2);
  },

  easeInQuart: function(value) {
    return Math.pow(value, 4);
  },

  easeOutQuart: function(value) {
    return -(Math.pow(value - 1, 4) - 1);
