     */
    this.items = Array.isArray(items) ? items : [items];
  }

  /**
   * Gets a random item.
   *
   * @return {mixed}
   */
  getValue() {
    return sample(this.items);
  }
}

/**
 * Attempts to create an ArraySpan from the items provided.
